import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Frontpage from "./js/frontpage.js";
import { BrowserRouter as Router } from "react-router-dom";

ReactDOM.render(
  <Router>
    <Frontpage />
  </Router>,
  document.getElementById("root")
);

